import React from 'react';
import Blog_main from "./Blog_main";
import News_header from "./News_header";
import { blogs } from './data'; // Поменяйте путь, если data.js находится в другом месте

function Main_page(){
    return(
        <section className="content">
            <News_header />
            {blogs.map((blog) => (
                <Blog_main key={blog.id} blog={blog} />
            ))}
        </section>
    );
}

export default Main_page;
